class Solution(object):
    def boardingPass(self, n, m):
        """
        :type n: int
        :type m: int
        :rtype: int
        """
        mod = 1000000007
        dp = [[0] * (n + 1) for _ in range(m + 1)]
        dp[0][0] = 1
        for i in range(1, m + 1):
            for j in range(1, n + 1):
                dp[i][j] = (dp[i][j - 1] + dp[i - 1][j - 1]) % mod
        return dp[m][n]

